import Vue from 'vue';
import Router from 'vue-router';
import Knights from './components/Knights/Knights'
import Hall from './components/hall/Hall'

Vue.use(Router);

export default new  Router({
    routes:[
        {
            path: '/knights',
            nome: 'Knights',
            component: Knights
        },
        {
            path: '/hall',
            nome: 'Hall',
            component: Hall
        }
    ]
})
